    vector<int> primeScore_;

    int getPrimeScore(int n) {
        if (n < 2) {
            return 0;
        }

        if (primeScore_[n] != -1) {
            return primeScore_[n];
        }

        int top = sqrt(n);
        int i = 0;
        while (PRIMES[i] <= top && (n % PRIMES[i])) {
            ++i;
        }
        int nn = n;
        if (0 == nn % PRIMES[i]) {
            while (0 == nn % PRIMES[i]) {
                nn /= PRIMES[i];
            }
            return primeScore_[n] = getPrimeScore(nn) + 1;
        } else {
            return 1;
        }
    }

